import React, { Component } from 'react';
import TextField from '@material-ui/core/TextField';

class OnermEntry extends Component {
    render() { 

        var inputStyle = {
            position: 'sticky',
            width: '50%',
            textAlign: 'center',
            justifyContent: 'center',
            height: '10rem',
            
        }

        return (
        <div style={inputStyle}>

        <h3>One Rep Max</h3>

        <form noValidate autoComplete="off">
        <TextField type="number" id="OneRM" label="Enter One Rep Max" variant="outlined" margin="dense" required="True" size="medium"/>
        </form>

        </div> );
    }
}
 
export default OnermEntry;
